export const styles = {
  container: {
    color: "#333",
  },
  mention: {
    color: "#990030",
    backgroundColor: "#f6e7ea"
  },
  header: {
    textAlign: "center"
  },
  label: {
    display: "flex",
    flexDirection: "column"
  },
  titleLabel: {
    fontWeight: "600",
    display: "inline-block",
    width: "100px"
  },
  span: {
    fontWeight: "400"
  }
}
